import axios from "../api/axios";

// For patient: single prediction
export async function createPrediction(data) {
  const res = await axios.post("/predict", data);
  return res.data;
}
// For doctor: batch predict
export async function batchPredict(file) {
  const formData = new FormData();
  formData.append("file", file);
  const res = await axios.post("/predict/batch", formData, {
    headers: { "Content-Type": "multipart/form-data" }
  });
  return res.data; // expected: { batch_results: [...] }
}
